@import url('https://fonts.googleapis.com/css2?family=Poppins:wght@100,300;500;700&display=swap');
@import url('https://fonts.googleapis.com/css2?family=Playfair+Display:wght@400;700&display=swap');
@import url('https://fonts.googleapis.com/css2?family=Montserrat:wght@300;500;700&display=swap');


/* Typography for home page */

/* NAVIGATION */

@mixin menu-link() {
    font-size: 45px;
    line-height: 60px;
    color: #fff;
    font-weight: bold;
}

@mixin menu-description {
    font-size: 17px;
    line-height: 25px;
    font-weight: 300;
    color: #c7d3ef;
}

@mixin menu-title {
    font-size: 17px;
    line-height: 25px;
    font-weight: bold;
    color: #6d7da3;
}


/* Navigation Showcase */

@mixin showcase-heading() {
    font-size: 50px;
    line-height: 60px;
    font-weight: normal;
    color: #282828;
}

@mixin showcase-link() {
    font-weight: lighter;
    @include linkReset(#fff);
    font-size: 20px;
    line-height: 20px;
    display: block;
}

/* HOME ABOUT */

@mixin home-about-title() {
    font-size: 40px;
    line-height: 48px;
    font-weight: 400;
    color: #fff;
}

@mixin home-about-description($fw) {
    font-size: 40px;
    line-height: 48px;
    font-weight: $fw;
    color: #fff;
}

@mixin home-about-description($fw) {
    font-size: 22px;
    line-height: 35px;
    font-weight: $fw;
    color: #fff;
}

/* SLIDER */

@mixin slider-heading() {
    font-size: 65px;
    line-height: 65px;
    color: #282828;
    font-weight: bold;
}

@mixin slider-p() {
    font-size: 20px;
    margin-top: .5rem;
    color: #282828;
    font-weight: bold;
}

/* DESIGN SPRINTS */

@mixin sprint-heading() {
    font-size: 90px;
    font-weight: bold;
    color: #fff;
    margin-bottom: 2rem;
}


@mixin sprint-heading-sub() {
    font-size: 38px;
    font-weight: normal;
    color: #fff;
    margin-bottom: 2rem;
}

@mixin sprint-p() {
    font-size: 20px;
    font-weight: 300;
    color: #fff;
    margin-bottom: 2rem;
}

/* OFFER */

@mixin offer-heading() {
    font-size: 27px;
    font-weight: bold;
    color: #282828;
}

@mixin offer-sub-heading() {
    font-size: 15px;
    font-weight: 500;
    color: #282828;
}


@mixin offer-p() {
    font-size: 32px;
    font-weight: 300;
    line-height: 1.2;

    letter-spacing: 1px;
    color: #282828;
}

/* ABOUT WOLF */

@mixin aboutwolf-sub() {
    color: #00ffce;
    font-size: 15px;
    font-weight: 400;
    margin-bottom: 2rem;
}

@mixin aboutwolf-heading() {
    color: #fff;
    font-size: 30px;
    font-weight: 400;
    margin-bottom: 3rem;
}

/* Lets Talk */

@mixin lets-talk-heading() {
    font-size: 55px;
    font-weight: bold;
    color: #fff;
    letter-spacing: 2px;
    margin-bottom: 1.5rem;
}

@mixin lets-talk-p {
    font-size: 24px;
    font-weight: 300;
    color: #fff;
    margin-bottom: 1.5rem;
}

/* Footer */

@mixin footer-p() {
    font-size: 24px;
    line-height: 30px;
    font-weight: 300;
    color: #090909;
}


@mixin footer-heading() {
    color: #090909;
    font-weight: bold;
    line-height: 28px;
    font-size: 18px;

}

@mixin footer-link() {
    font-weight: 300;
    font-size: 16px;
    line-height: 28px;
    color: #090909;
    @include linkReset(#090909);
}

/*************************** ABOUT US PAGE ******************************/

@mixin about-header-showcase() {
    font-size: 90px;
    line-height: 100px;
    font-weight: bold;
    color: $clr01;
    text-align: center;
    padding: 0;
}

@mixin team-sub() {
