    line-height: 63px;
    color: #d9e6ff;
}

@mixin team-p($fw) {
    font-size: 22px;
    line-height: 35px;
    color: #fff;
    font-weight: $fw;
}

@mixin team-h3() {
    font-size: 30px;
    font-weight: 400;
    color: #fff;
