/* TEAM DESCRIPTION */

@mixin team-desc-heading() {
    font-size: 32px;
    color: #854ff6;
    letter-spacing: 1px;
    font-weight: bold;
}

@mixin team-desc-p() {
    font-size: 20px;
    line-height: 30px;
    color: #282828;
    font-weight: lighter;
}

/* THE PACK */

@mixin pack-heading() {
    font-size: 150px;
