    font-weight: bold;

}

/********************** CASE STUDIES PAGE ***********************************/

@mixin cs-header-sub {
    font-size: 18px;
    color: #a3a4a9;
    font-weight: lighter;
}

@mixin cs-header-showcase {
    font-size: 90px;
    color: #431578;
    font-weight: normal;
}

@mixin cs-span($clr) {
    font-size: 15px;
    font-weight: 400;
    color: $clr;
}

@mixin cs-header($clr) {
    font-size: 45px;
    font-weight: 400;
    line-height: 55px;
