    color: #431578;
    line-height: 100px;
    font-weight: bold;
    font-family: 'Playfair Display', sans-serif;
}

@mixin hww-showcase-p-bold {
    font-size: 27px;
    line-height: 48px;
    font-weight: bold;
    color: #282828;
}

@mixin hww-showcase-p-light {
    font-size: 27px;
    line-height: 48px;
    font-weight: 300;
