.header-about {
    background: none;
    height: auto;
}

.aboutWolf-about {
    margin-top: 0;
}

/* Showcase Heading */
.header-about {
    .about-showcase {
        background: none;

        h2 {
            @include pack-heading();
            margin: 5rem 0;
        }
    }
}

/* MAIN CONTENT ABOUT US PAGE */
.main-about {
    .team-description {
        background: $clr01;

        .showcase {
            width: 100%;
            height: auto;
            margin-top: -3rem;
        }

        &__content-top {
            text-align: center;
            @include maxWidthInner();
            padding: 6rem 0;

            h2 {
                @include team-sub();
                margin-bottom: 1.5rem;
                position: relative;
                display: inline-block;

                &:before {
                    content: '';
                    position: absolute;
                    left: 50%;
                    transform: translateX(-50%);
                    bottom: -12px;
                    width: 90%;
                    height: 2px;
                    background: $clr02;
                }
            }

            h1 {
                @include team-heading();
                margin-bottom: 1.5rem;
            }

            p {
                @include team-p(lighter);
                margin-bottom: 1.5rem;
            }


            h3 {
                @include team-h3();
            }

        }

        &__content-bottom {
            background: #fff;
            display: grid;
            grid-template-columns: 1fr 1fr;
            grid-template-areas: 'content-one showcase-one''showcase-two content-two';

            &__left-content-one {
                grid-area: content-one;
                padding: $padding;
                @include flexbox(center, start);
                height: 100%;
                flex-direction: column;

                h2 {
                    @include team-desc-heading();
                    margin-bottom: 1.5rem;
                }

                p {
                    @include team-desc-p();
                }
            }

            &__right-showcase-one {
                grid-area: showcase-one;

                img {
                    width: 100%;
                    height: 60vh;
                    display: block;
                }
            }

            &__right-content-two {
                grid-area: content-two;
                padding: $padding;
                @include flexbox(center, start);
                height: 100%;
                flex-direction: column;

                h2 {
                    @include team-desc-heading();
                    margin-bottom: 1.5rem;
                }

                p {
                    @include team-desc-p();
                }
            }

            &__left-showcase-two {
                grid-area: showcase-two;

                img {
                    width: 100%;
                    height: 55vh;
                    display: block;
                }
            }
        }
    }

    /* THE PACK */

    .thePack {
        .heading {
            @include pack-heading();
            margin: 10rem 0;
        }

        &__content {
            img {
                width: 100%;
                height: auto;
                display: block;
                filter: grayscale(100%);

                &:hover {
                    filter: grayscale(0);
                }
            }

            /* flex description & quote */

            &__flex {
                @include flexbox(space-between, center);
                width: 100%;
                height: auto;
                position: relative;
                z-index: 3;
                margin-top: -3rem;

                &__left-quote,
                &__right-desc {
                    width: 50%;
                    @include flexbox(center, center);
                    flex-direction: column;
                    height: 60vh;

                    h2,
                    span,
                    p {
                        width: 50%;
                    }

                    h2 {
                        @include team-quote();
                        padding-bottom: 2rem;
                    }

                    span {
                        @include team-quote-author();
                    }

                    p:nth-child(1) {
                        @include team-quote-p(lighter);
                        margin-bottom: 1rem;
                    }

                    p:nth-child(2) {
                        @include team-quote-p(bold);
                        margin-bottom: 1rem;
                    }
                }

                &__right-desc {
                    background: $clr02;
                }
            }

        }
    }

    /* Partners */

    .partners {
        margin-top: 10rem;

        .heading {
            @include global-heading();
            text-align: center;
            margin: 3rem 0;
