@media screen and(max-width: 768px) {
    .main {
        .project-information {
            max-width: 100%;
            flex-direction: column;
            padding: $padding;

            &__right-description {
                width: 100%;
                margin-top: 2rem;
            }

            &__left-info {
                width: 100%;
                margin-left: 0;

                .info {
                    margin-left: 0;
                }
            }
        }

        .showcase-description-one,
        .showcase-description-two,
        .showcase-description-three,
        .showcase-description-five {
            max-width: 100%;
            flex-direction: column;
            flex-wrap: wrap;
            @include flexbox(start, start);
            padding: $padding;

            &__heading {
                margin-bottom: 1.5rem;

                @include case-content-heading();
                text-align: center;
                display: inline-block;
            }

            &__description {
                max-width: 100%;
            }
        }

        .showcase {

            .showcase-description-one,
            .showcase-description-two,
            .showcase-description-three,
            .showcase-description-five,
            .showcase-description-six {
                max-width: 100%;
                flex-direction: column;
                flex-wrap: wrap;
                @include flexbox(start, start);
                padding: $padding;

                &__heading {
                    margin-bottom: 1.5rem;

                    @include case-content-heading();
                    text-align: center;
                    display: inline-block;
                }

                &__description {
                    max-width: 100%;
                }
            }

            .showcase-description-six {
                @include flexbox(start, center);

                &__heading {
                    width: 100%;
                }

                &__description {
                    width: 100%;
                }
            }
        }

        .other-works 
        {
            .works 
            {
                font-size: 2rem;
            }
        }
    }
}

@media screen and(max-width: 500px) {
    .main {
        .project-information {
            max-width: 100%;
            flex-direction: column;
            padding: 0 2rem;

            &__right-description {
                width: 100%;
                margin-top: 2rem;
            }

            &__left-info {
                width: 100%;
            }
        }

        .showcase-description-one,
        .showcase-description-two,
        .showcase-description-three,
        .showcase-description-five {
            max-width: 100%;
            flex-direction: column;
            flex-wrap: wrap;
            @include flexbox(start, start);
            padding: $padding;

            &__heading {
                margin-bottom: 1.5rem;
                display: none;
                @include case-content-heading();
                text-align: center;
                display: inline-block;
            }

            &__description {
                max-width: 100%;
            }
        }

        .testimonial-projects {
            flex-direction: column;


            &__description,
            &__author {
                width: 100%;
                padding: 0 2rem;
            }

            &__description {
                margin-bottom: 2rem;

                h2 {
